import React from "react";
import axios from "axios";

const Login = () => {
  return (
    <div>
      <h1 class="flex justify-center font-bold text-gray-800 text-2xl py-4">
        Login
      </h1>
      <div class="flex justify-center h-screen">
        <form class="w-full max-w-lg">
          <input
            class="appearance-none w-1/2 bg-gray-200 text-gray-700 border border-gray-200 rounded py-3 px-4 mb-1 leading-tight focus:outline-none focus:bg-white"
            type="text"
            name="username"
            placeholder="Username"
          />
          <input
            class="appearance-none block w-1/2 bg-gray-200 text-gray-700 border border-gray-200 rounded py-3 px-4 leading-tight focus:outline-none focus:bg-white focus:border-gray-500"
            type="password"
            name="password"
            placeholder="Password"
          />
          <button type="submit">Login</button>
        </form>
      </div>
    </div>
  );
};

export default Login;
